(1, 'Комплексное удобрение Универсал-2 NPK 12:8:14', '<div class=\"product-zoom-sdesc\">\r\n	<ul>\r\n		<li>\r\n			Комплексное гранулированное удобрение\r\n		</li>\r\n		<li>\r\n			Рекомендуется для выращивания овощных, зеленых, плодово-ягодных культур, декоративных, хвойных деревьев и кустарников\r\n		</li>\r\n		<li>\r\n			Содержит все необходимые для питания растений макро и микроэлементы в оптимальном соотношении\r\n		</li>\r\n		<li>\r\n			Без хлора\r\n		</li>\r\n		<li>\r\n			Не подкисляет почву\r\n		</li>\r\n		<li>\r\n			Способствует хорошему росту растений и получению высокого урожая\r\n		</li>\r\n		<li>\r\n			Упаковка: пластиковые пакеты по 1.0, 2.5, 5.0, 10.0 и 25.0 кг\r\n		</li>\r\n	</ul>\r\n</div>', 'Комплексное удобрение Универсал-2 NPK 12:8:14', '<div class=\"product-zoom-sdesc\">\r\n	<ul>\r\n		<li>\r\n			Комплексное гранулированное удобрение\r\n		</li>\r\n		<li>\r\n			Рекомендуется для выращивания овощных, зеленых, плодово-ягодных культур, декоративных, хвойных деревьев и кустарников\r\n		</li>\r\n		<li>\r\n			Содержит все необходимые для питания растений макро и микроэлементы в оптимальном соотношении\r\n		</li>\r\n		<li>\r\n			Без хлора\r\n		</li>\r\n		<li>\r\n			Не подкисляет почву\r\n		</li>\r\n		<li>\r\n			Способствует хорошему росту растений и получению высокого урожая\r\n		</li>\r\n		<li>\r\n			Упаковка: пластиковые пакеты по 1.0, 2.5, 5.0, 10.0 и 25.0 кг\r\n		</li>\r\n	</ul>\r\n</div>', 'Комплексное удобрение Универсал-2 NPK 12:8:14', '<div class=\"product-zoom-sdesc\">\r\n	<ul>\r\n		<li>\r\n			Комплексное гранулированное удобрение\r\n		</li>\r\n		<li>\r\n			Рекомендуется для выращивания овощных, зеленых, плодово-ягодных культур, декоративных, хвойных деревьев и кустарников\r\n		</li>\r\n		<li>\r\n			Содержит все необходимые для питания растений макро и микроэлементы в оптимальном соотношении\r\n		</li>\r\n		<li>\r\n			Без хлора\r\n		</li>\r\n		<li>\r\n			Не подкисляет почву\r\n		</li>\r\n		<li>\r\n			Способствует хорошему росту растений и получению высокого урожая\r\n		</li>\r\n		<li>\r\n			Упаковка: пластиковые пакеты по 1.0, 2.5, 5.0, 10.0 и 25.0 кг\r\n		</li>\r\n	</ul>\r\n</div>', '/media/2018/05/30/ips_logo.png', '1', 'Весной удобрение равномерно разбрасывают по поверхности почвы, затем перекапывают. Гранулы удобрения растворяются в почве постепенно, обеспечивая бесперебойное и сбалансированное питание растений на протяжении всего периода вегетации. ', 'Весной удобрение равномерно разбрасывают по поверхности почвы, затем перекапывают. Гранулы удобрения растворяются в почве постепенно, обеспечивая бесперебойное и сбалансированное питание растений на протяжении всего периода вегетации. ', 'Весной удобрение равномерно разбрасывают по поверхности почвы, затем перекапывают. Гранулы удобрения растворяются в почве постепенно, обеспечивая бесперебойное и сбалансированное питание растений на протяжении всего периода вегетации. ', '2018-05-30 16:07:44', '2018-05-30 16:07:44', NULL, 0, 'Комплексное удобрение Универсал-2 NPK 12:8:14', 'Комплексное удобрение Универсал-2 NPK 12:8:14', 'Комплексное удобрение Универсал-2 NPK 12:8:14', 'Комплексное удобрение Универсал-2 NPK 12:8:14', 'Комплексное удобрение Универсал-2 NPK 12:8:14', 'Комплексное удобрение Универсал-2 NPK 12:8:14', NULL, 1, 1),
