(8, 'Карта ссылка (контакты)', 'Карта ссылка (контакты)', 'Карта ссылка (контакты)', '', '<iframe src=\"https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d2906.483945387611!2d76.92990911492996!3d43.241278286987935!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x38836ec4d86f1a55%3A0x1e595c29b7a53df0!2z0L_RgNC-0YHQvy4g0JDQsdCw0Y8gMzQsINCQ0LvQvNCw0YLRiw!5e0!3m2!1sru!2skz!4v1527693668092\" width=\"600\" height=\"450\" frameborder=\"0\">\r\n</iframe>', '<iframe src=\"https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d2906.483945387611!2d76.92990911492996!3d43.241278286987935!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x38836ec4d86f1a55%3A0x1e595c29b7a53df0!2z0L_RgNC-0YHQvy4g0JDQsdCw0Y8gMzQsINCQ0LvQvNCw0YLRiw!5e0!3m2!1sru!2skz!4v1527693668092\" width=\"600\" height=\"450\" frameborder=\"0\">\r\n</iframe>', '<iframe src=\"https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d2906.483945387611!2d76.92990911492996!3d43.241278286987935!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x38836ec4d86f1a55%3A0x1e595c29b7a53df0!2z0L_RgNC-0YHQvy4g0JDQsdCw0Y8gMzQsINCQ0LvQvNCw0YLRiw!5e0!3m2!1sru!2skz!4v1527693668092\" width=\"600\" height=\"450\" frameborder=\"0\">\r\n</iframe>', '', '1', '2018-05-30 15:21:32', '2018-05-30 15:21:32', NULL),
(9, 'О нас (на главной странице)', 'О нас (на главной странице)', 'О нас (на главной странице)', '', 'Возможно внесение удобрения и другим, более эффективным способом – в \r\nрядки при посеве семян или в лунки при посадке рассады. При этом почву и\r\n удобрение обязательно перемешивают. Гранулы удобрения сконцентрированы \r\nвокруг семян и корней рассады, что способствует лучшему снабжению \r\nмолодых растений элементами питания. <br />', 'Возможно внесение удобрения и другим, более эффективным способом – в \r\nрядки при посеве семян или в лунки при посадке рассады. При этом почву и\r\n удобрение обязательно перемешивают. Гранулы удобрения сконцентрированы \r\nвокруг семян и корней рассады, что способствует лучшему снабжению \r\nмолодых растений элементами питания. <br />', 'Возможно внесение удобрения и другим, более эффективным способом – в \r\nрядки при посеве семян или в лунки при посадке рассады. При этом почву и\r\n удобрение обязательно перемешивают. Гранулы удобрения сконцентрированы \r\nвокруг семян и корней рассады, что способствует лучшему снабжению \r\nмолодых растений элементами питания. <br />', '', '1', '2018-05-30 19:06:17', '2018-05-30 19:06:17', NULL),
(10, 'надпись в футере', 'надпись в футере', 'надпись в футере', '', '<p>\r\n	Потребность растений в подкормках, их состав и пропорции между \r\nэлементами меняются в разные периоды роста растений. Следовательно, \r\nэлементы необходимы в большем количестве на ранних фазах развития, а в \r\nконечных фазах их значение ослабевает.\r\n</p>\r\n<p>\r\n	Одной из важных составляющих современных с/х технологий является \r\nсистема применения удобрений. Для обеспечения чистоты и качества \r\nпродуктов важно применять удобрения с точно сбалансированным \r\nсоотношением всех элементов питания, производимые из чистых сырьевых \r\nматериалов.\r\n</p>', '<p>\r\n	Потребность растений в подкормках, их состав и пропорции между \r\nэлементами меняются в разные периоды роста растений. Следовательно, \r\nэлементы необходимы в большем количестве на ранних фазах развития, а в \r\nконечных фазах их значение ослабевает.\r\n</p>\r\n<p>\r\n	Одной из важных составляющих современных с/х технологий является \r\nсистема применения удобрений. Для обеспечения чистоты и качества \r\nпродуктов важно применять удобрения с точно сбалансированным \r\nсоотношением всех элементов питания, производимые из чистых сырьевых \r\nматериалов.\r\n</p>', '<p>\r\n	Потребность растений в подкормках, их состав и пропорции между \r\nэлементами меняются в разные периоды роста растений. Следовательно, \r\nэлементы необходимы в большем количестве на ранних фазах развития, а в \r\nконечных фазах их значение ослабевает.\r\n</p>\r\n<p>\r\n	Одной из важных составляющих современных с/х технологий является \r\nсистема применения удобрений. Для обеспечения чистоты и качества \r\nпродуктов важно применять удобрения с точно сбалансированным \r\nсоотношением всех элементов питания, производимые из чистых сырьевых \r\nматериалов.\r\n</p>', '', '1', '2018-05-30 19:24:05', '2018-05-30 19:24:05', NULL),
