(38, 'Наша история', 'Наша история', 'Наша история', NULL, 'Наша история', 'Наша история', 'Наша история', 'Наша история', 'Наша история', 'Наша история', 'Наша история', 'Наша история', 'Наша история', 'nasha-istoriya', 'nasha-istoriya', 'nasha-istoriya', '', NULL, '1', NULL, 1, '2018-05-29 22:26:26', '2018-05-30 15:02:46', NULL, NULL, '', '', '', '', '', 34, '<p>\r\n	В современном обществе на человека действует много отрицательных \r\nфакторов: неблагоприятная экология, нервные стрессы, загрязнение \r\nпродуктов пестицидами, недостаток витаминов. Именно поэтому особое \r\nвнимание должно уделяться качеству продуктов питания, овощей, фруктов, \r\nзеленых культур и их экологической безопасности. На качество и чистоту \r\nбудущего урожая необходимо обращать внимание уже при планировании \r\nтехнологии выращивания. Хороший урожай определяют климатические условия,\r\n доступность воды, но в большей степени – доступность питательных \r\nвеществ в течение всего периода вегетации. Оптимальные пропорции между \r\nкомпонентами питания и сохранение питательного баланса – основа будущего\r\n здорового урожая.\r\n</p>\r\n<p>\r\n	Потребность растений в подкормках, их состав и пропорции между \r\nэлементами меняются в разные периоды роста растений. Следовательно, \r\nэлементы необходимы в большем количестве на ранних фазах развития, а в \r\nконечных фазах их значение ослабевает.\r\n</p>\r\n<p>\r\n	Одной из важных составляющих современных с/х технологий является \r\nсистема применения удобрений. Для обеспечения чистоты и качества \r\nпродуктов важно применять удобрения с точно сбалансированным \r\nсоотношением всех элементов питания, производимые из чистых сырьевых \r\nматериалов.\r\n</p>\r\n<p>\r\n	Удобрения FERTIKA производятся на основе компонентов компании Yara, \r\nкоторые разработаны для технологий третьего тысячелетия, современных \r\nсортов садовых культур, с учётом свойств почвы и защиты окружающей \r\nсреды.\r\n</p>\r\n<p>\r\n	Ассортимент удобрений FERTIKA тщательно подобран с учетом сезонных \r\nпотребностей выращиваемых на приусадебных участках сельскохозяйственных \r\nкультур, декоративных растений и газона.\r\n</p>\r\n<p>\r\n	Основные преимущества комплексных минеральных удобрений FERTIKA:\r\n</p>', '<p>\r\n	В современном обществе на человека действует много отрицательных \r\nфакторов: неблагоприятная экология, нервные стрессы, загрязнение \r\nпродуктов пестицидами, недостаток витаминов. Именно поэтому особое \r\nвнимание должно уделяться качеству продуктов питания, овощей, фруктов, \r\nзеленых культур и их экологической безопасности. На качество и чистоту \r\nбудущего урожая необходимо обращать внимание уже при планировании \r\nтехнологии выращивания. Хороший урожай определяют климатические условия,\r\n доступность воды, но в большей степени – доступность питательных \r\nвеществ в течение всего периода вегетации. Оптимальные пропорции между \r\nкомпонентами питания и сохранение питательного баланса – основа будущего\r\n здорового урожая.\r\n</p>\r\n<p>\r\n	Потребность растений в подкормках, их состав и пропорции между \r\nэлементами меняются в разные периоды роста растений. Следовательно, \r\nэлементы необходимы в большем количестве на ранних фазах развития, а в \r\nконечных фазах их значение ослабевает.\r\n</p>\r\n<p>\r\n	Одной из важных составляющих современных с/х технологий является \r\nсистема применения удобрений. Для обеспечения чистоты и качества \r\nпродуктов важно применять удобрения с точно сбалансированным \r\nсоотношением всех элементов питания, производимые из чистых сырьевых \r\nматериалов.\r\n</p>\r\n<p>\r\n	Удобрения FERTIKA производятся на основе компонентов компании Yara, \r\nкоторые разработаны для технологий третьего тысячелетия, современных \r\nсортов садовых культур, с учётом свойств почвы и защиты окружающей \r\nсреды.\r\n</p>\r\n<p>\r\n	Ассортимент удобрений FERTIKA тщательно подобран с учетом сезонных \r\nпотребностей выращиваемых на приусадебных участках сельскохозяйственных \r\nкультур, декоративных растений и газона.\r\n</p>\r\n<p>\r\n	Основные преимущества комплексных минеральных удобрений FERTIKA:\r\n</p>', '<p>\r\n	В современном обществе на человека действует много отрицательных \r\nфакторов: неблагоприятная экология, нервные стрессы, загрязнение \r\nпродуктов пестицидами, недостаток витаминов. Именно поэтому особое \r\nвнимание должно уделяться качеству продуктов питания, овощей, фруктов, \r\nзеленых культур и их экологической безопасности. На качество и чистоту \r\nбудущего урожая необходимо обращать внимание уже при планировании \r\nтехнологии выращивания. Хороший урожай определяют климатические условия,\r\n доступность воды, но в большей степени – доступность питательных \r\nвеществ в течение всего периода вегетации. Оптимальные пропорции между \r\nкомпонентами питания и сохранение питательного баланса – основа будущего\r\n здорового урожая.\r\n</p>\r\n<p>\r\n	Потребность растений в подкормках, их состав и пропорции между \r\nэлементами меняются в разные периоды роста растений. Следовательно, \r\nэлементы необходимы в большем количестве на ранних фазах развития, а в \r\nконечных фазах их значение ослабевает.\r\n</p>\r\n<p>\r\n	Одной из важных составляющих современных с/х технологий является \r\nсистема применения удобрений. Для обеспечения чистоты и качества \r\nпродуктов важно применять удобрения с точно сбалансированным \r\nсоотношением всех элементов питания, производимые из чистых сырьевых \r\nматериалов.\r\n</p>\r\n<p>\r\n	Удобрения FERTIKA производятся на основе компонентов компании Yara, \r\nкоторые разработаны для технологий третьего тысячелетия, современных \r\nсортов садовых культур, с учётом свойств почвы и защиты окружающей \r\nсреды.\r\n</p>\r\n<p>\r\n	Ассортимент удобрений FERTIKA тщательно подобран с учетом сезонных \r\nпотребностей выращиваемых на приусадебных участках сельскохозяйственных \r\nкультур, декоративных растений и газона.\r\n</p>\r\n<p>\r\n	Основные преимущества комплексных минеральных удобрений FERTIKA:\r\n</p>', '/static/img/content/header-bg.jpg'),
